    true,nt"url": null,nt"notes": "BRI/COLA & Earmark File - RRB sends an "Earmark
    File" of all RRB annuitants each year prior to BRI/COLA. This file is passed through
    BACOM to earmark related MBR records. The BRI/COLA operation extracts certain MBR
    information earmarked for RRB involvement or for RRB jurisdiction for Medicare.
    This information is essential to computing the amount of railroad retirement annuities
    after a Social Security cost-of-living increase affecting railroad retirement beneficiaries
    covered by the retirement programs administered by the RRB.",nt"license_title":
